CREATE DEFINER=`root`@`localhost` FUNCTION `levenshtein_search` (`user_input` VARCHAR(255), `column_name` VARCHAR(255)) RETURNS INT(11) DETERMINISTIC BEGIN
  DECLARE i, j, c, c_temp, cost INT;
  DECLARE s1_char CHAR;
  DECLARE cv0, cv1 VARBINARY(256);

  SET cv1 = 0x00;
  SET j = 1;
  SET i = 1;
  SET c = 0;

  IF user_input IS NULL OR column_name IS NULL THEN
    RETURN NULL; -- Handle NULL inputs
  END IF;

  WHILE j <= CHAR_LENGTH(column_name) DO
    SET cv1 = CONCAT(cv1, UNHEX(HEX(j)));
    SET j = j + 1;
  END WHILE;

  WHILE i <= CHAR_LENGTH(user_input) DO
    SET s1_char = SUBSTRING(user_input, i, 1);
    SET c = i;
    SET cv0 = UNHEX(HEX(i));
    SET j = 1;

    WHILE j <= CHAR_LENGTH(column_name) DO
      SET c = c + 1;
      IF s1_char = SUBSTRING(column_name, j, 1) THEN
        SET cost = 0;
      ELSE
        SET cost = 1;
      END IF;

      SET c_temp = CONV(HEX(SUBSTRING(cv1, j, 1)), 16, 10) + cost;
      IF c > c_temp THEN
        SET c = c_temp;
      END IF;

      SET c_temp = CONV(HEX(SUBSTRING(cv1, j+1, 1)), 16, 10) + 1;
      IF c > c_temp THEN
        SET c = c_temp;
      END IF;

      SET cv0 = CONCAT(cv0, UNHEX(HEX(c)));
      SET j = j + 1;
    END WHILE;

    SET cv1 = cv0;
    SET i = i + 1;
  END WHILE;

  RETURN c;
END$$

